['#include<stdio.h>
void bubble_sort(int array[],int piece)
{
    int i,j,temp;
    for(i=0; i<piece; i++)
    {
        for(j=0; j<piece-i-1; j++)
        {
            if(array[j]<array[j+1])
            {
                temp=array[j];
                array[j]=array[j+1];
                array[j+1]=temp;
            }
        }
    }

}

main()
{
    int i,array[5];
    for(i=0; i<3; i++)
    {
        scanf("%d",&array[i]);
    }
    bubble_sort(array,3);
    for(i=1; i<2; i++)
    {
        int ans1=array[i-1]-array[i];
        int ans2=array[i]-array[i+1];
        int ans=ans1+ans2;
        printf("%d",ans);


    }


}
']

