['#include <stdio.h>

int arr[4];
int temp[4];

void mergeSort(int left, int right) {
	if (left == right) {
		return; 
	}
	int mid = (left + right) / 2;
	
	
	mergeSort(left, mid);
	mergeSort(mid+1, right);
	
	int i = left;
	int j = mid+1;
	int idx = 0;
	while(i <= mid && j <= right) {
		if (arr[i] < arr[j]) {
			temp[idx] = arr[i];
			i++;
		} else {
			temp[idx] = arr[j];
			j++;
		}
		idx++;
	}
	while(i <= mid) {
		temp[idx] = arr[i];
		idx++;
		i++;
	}
	while(j <= right) {
		temp[idx] = arr[j];
		idx++;
		j++;
	}
	for(int k=left; k<=right; k++) {
		arr[k] = temp[k-left];
	}
}


int main()
{
	scanf("%d %d %d",&arr[0],&arr[1],&arr[2]);
	
	mergeSort(0,2);
	
	int temp = 0;
	temp = arr[1]-arr[0];
	printf("%d\n",temp);
	
	
	
	return 0;
}
']

