['#include<stdio.h>
void sort(int a[])
{
	int i,k,j;
	for(i=1;i<3;i++)
	{
		k=a[i];
		for(j=i-1;j>=0&&k<a[j];j--)
		{
			a[j+1]=a[j];
		}
		a[j+1]=k;
	}
}
int min(int a[])
{
	int b[3];
	b[0]=a[2]+a[1]-2*a[0];
	b[1]=a[2]-a[0];
	b[2]=2*a[2]-(a[1]+a[0]);
	sort(b);
	return b[0];
}
int main()
{
	int a[3],i,m;
	for(i=0;i<3;i++)
	{
		scanf("%d",&a[i]);
	}
	sort(a);
	m=min(a);
	printf("%d",m);
	return 0;
}']

