['#include <stdio.h>
#include <stdlib.h>
#include <string.h>
int findmax (int,int,int);
int findmin(int,int,int);
int main(int argc, char *argv[]) 
{
	int a,b,c;
	scanf("%d %d %d",&a,&b,&c);
	printf("%d",findmax(a,b,c)-findmin(a,b,c));
}

int findmax(int a,int b,int c)
{
	if(a>=b&&a>=c)
		return a;
	else if(b>=a&&b>=c)
		return b;
	else if(c>=a&&c>=b)
		return c;
}

int findmin(int a,int b,int c)
{
	if(a<=b&&a<=c)
		return a;
	else if(b<=a&&b<=c)
		return b;
	else if(c<=a&&c<=b)
		return c;
}']

['#include<stdio.h>
