int mina(int,int);

int main()
{
	int a,b,c,avg1,avg2,answer,sum1,sum2;
	scanf("%d%d%d",&a,&b,&c);
	avg1=(a+b+c)/3;
	
	avg2=avg1+1;
	
	sum1=moda(avg1-a) + moda(avg1-b) + moda(avg1-c);
	sum2=moda(avg2-a) + moda(avg2-b) + moda(avg2-c);
	
	answer=mina(sum1,sum2);
	
	printf("%d",answer);
}

int moda(int a)
{
	if(a<0)
		return -a;
	else 
		return a;
}

int mina(int a,int b)
{
	if(a<b)
		return a;
	else
		return b;
}']

