['#include<stdio.h>
#include<stdlib.h>
int cmp(int *a,int *b)
{
    return *a-*b;
}
int cal(int *a,int g)
{
    int h,i,f=0;
    for(i=0;i<3;i++)
    {
        h=g-a[i];
        if(h<0) h=-h;
        f+=h;
    }
    return f;
}
int main()
{
    int a[3],i,g,k,u,v;
    for(i=0;i<3;i++) scanf("%d",&a[i]);
    qsort(a,3,sizeof(int),cmp);

    k=a[0]+a[2];
    g=k/2;
    if(k%2)
    {
        u=cal(a,g);
        v=cal(a,g+1);
        u<v? printf("%d",u) : printf("%d",v);
    }

    else printf("%d",cal(a,g));
}
']

