['#include<stdio.h>
#include<string.h>
#include<math.h>
#define N 1000
 
int main()
{
	int max=0,num=0,n;
	char s[N],t[N];
	
	scanf("%d %s",&n,s);
	
	for(int i=0;i<n;i++)
	t[i]=s[i];
	
	t[n]='\0';
	

	char *p2=strchr(s,'(');
	char *p=strchr(s,')');
	char *p1=strtok(s,"_");
	
	while(p1 && (p1<p2 || p1>p))
	{
		int a=strcspn(p1,"()");
		
		if(a>max)
		max=a;
		
		p2=strchr(p1+1,'(');
		p=strchr(p1+1,')');
		p1=strtok(NULL,"_");
	}
		
	p1=strchr(t,'(');
	p=p1;
	
	while(p1)
	{
		p2=strtok(p1+1,"_)");
		
		while(p2 && *(p2+1)!=')')
		{
			num++;
			p2=strtok(NULL,"_)");
		}
		
		p1=strchr(p+1,'(');
		p=p1;
	}
	
	printf("%d %d",max,num-1);
}
