#include<math.h>
#define N 1000
 
int main()
{
	int max=0,num=0,n;
	char s[N];
	
	scanf("%d %s",&n,s);

	char *p2=strchr(s,'(');
	char *p=strchr(s,')');
	char *p1=strtok(s,"_");
	
	while(p1)
	{
		int l=strcspn(p1,"()");
		
		if(p2<p1 && p1<p && l)
		num++;
		
		else if(l>max)
		max=l;
		
		p2=strchr(p1+1,'(');
		p=strchr(p1+1,')');
		p1=strtok(NULL,"_");
	}
	printf("%d %d",max,num);
}
