['#include<stdio.h>
#include<time.h>
#include<stdlib.h>
#include<stdbool.h>
#include<string.h>
#include<math.h>
#include<ctype.h>


int main()
{
	int n;
	scanf("%d", &n);

	char str[256];
	scanf("%s", str);

	bool flag = false;
	int cnt_underline = 0 , cnt_word = 0 , final_cnt = 0 , cnt = 0;
	
	for (int i = 0; i < n;i++) {

		if (str[i] == '(' || str[i] == ')') { flag = !flag; cnt++; }

		if (i > 0 && i < n-1)
		{
			if (flag && str[i] == '_' && str[i - 1] != '_' && str[i - 1] != '(' && str[i - 1] != ')' && str[i + 1] != '(' && str[i + 1] != ')') {
				cnt_underline++;
			}
		}

		if (!flag && str[i] != '_' && str[i] != '(' && str[i] != ')') {
			cnt_word++;
		}
		else if (!flag && (str[i] == '_' || str[i] == '(' || str[i] == ')')) {
			if (final_cnt < cnt_word) {
				final_cnt = cnt_word;
			}
			cnt_word = 0;
		}
		
	}
	if (cnt_underline == 0)
	{
		cnt = 0;
	}
	printf("%d %d", final_cnt , cnt_underline + (cnt / 2));

}']

