    scanf("%s", str);
    while (str[i] != '\0') {
        if (str[i] == '(') isOutsideParantheses = 0;
        if (str[i] == ')') { 
            if (isWord) { 
                wordsCount++; 
                isWord = 0; 
            } 
            isOutsideParantheses = 1; 
        }        
        if (isalpha(str[i]) && isOutsideParantheses) {
            wordLength++;
            if (wordLength > maxWordLength) maxWordLength = wordLength;

        }
        if (isalpha(str[i]) && !isOutsideParantheses) {
            isWord = 1;
        }
        if (str[i] == '_') {
            if (isWord) {
                isWord = 0;
                wordsCount++;
            }
            wordLength = 0;
        } 
        i++;
    }
    printf("%d %d\n", maxWordLength, wordsCount);
}']

