['#include <stdio.h>

void select_sort(unsigned* a, unsigned size) 
{
	unsigned min, idx;
	for (unsigned i = 0; i < size; i++) 
	{
		min = a[i];
		idx = i;
		for (unsigned j = i+1; j < size; j++)
		{
			if (a[j] < min)
			{
				min = a[j];
				idx = j;
			}
		}
		a[idx] = a[i];
		a[i] = min; 
	}
}

unsigned abs(unsigned a, unsigned b)
{
	if (a > b)
		return a-b;
	else
		return b-a;
}

