['#include <stdlib.h>
#include <stdio.h>
#include <string.h>
#include <math.h>

char * read_line();
void allocate_error();
unsigned short condition();

int main() {

	char * buffer = read_line();
	char * rest = buffer;
	short n1;
    short n2;
    short n3;
	unsigned short average;
	unsigned short distance = 0;

	n1 = (short) strtol(rest, &rest, 10);
	n2 = (short) strtol(rest, &rest, 10);
	n3 = (short) strtol(rest, &rest, 10);

	// n1 is the middle one
	if ((n1 <= n2 && n1 >= n3) || (n1 >= n2 && n1 <= n3))
		printf("%d\n", abs(n3 - n1) + abs(n2 - n1));

	// n2 is the middle one
	else if ((n2 <= n1 && n2 >= n3) || (n2 <= n3 && n2 >= n1))
		printf("%d\n", abs(n1 - n2) + abs(n3 - n2));

	// n3 is the middle one
	else
		printf("%d\n", abs(n1 - n3) + abs(n2 - n3));

	return EXIT_SUCCESS;
}

char * read_line() {

	unsigned short buffersize = 5;
	unsigned short line_index = 0;

	char * line = malloc(buffersize);
	char * tmp;

	// ERROR
	if (line == NULL)
		allocate_error();
	// ERROR

	int character;

	while ((character = getchar()) != '\n' && character != EOF && buffersize < 65535) {

		// BUFFER IS TOO SMALL
		if (buffersize <= line_index + 1) {
			buffersize += 10;
			tmp = realloc(line, buffersize);

			// ERROR
			if (tmp == NULL)
				allocate_error();
			// ERROR

			line = tmp;
		}
		// BUFFER IS TOO SMALL

		line[line_index++] = (char) character;
	}

	// Set the end of the line
	line[line_index] = '\0';

	// Fit the allocated memory to the string lenght => No wasted memory
	tmp = realloc(line, strlen(line) + 1);

	// ERROR
	if (tmp == NULL)
		allocate_error();
	// ERROR

	line = tmp;
	return line;
}

void allocate_error() {
	perror("Couldn't allocate memory!");
	exit(1);
}
