    int temp;                    //temporary variable used while sorting the array
    int dis;                    //the required total minimum distance
    //scanning the array
    scanf("%d%d%d",&loc[0], &loc[1], &loc[2]);
    //sorting the array in an ascending order
    for (i =0; i<3;i++)
    {
        for (j=i+1; j<3;j++)
        {
            if (loc[i] > loc[j])
            {
                //swap the elements in the array to sort it
                temp =  loc[i];
                loc[i] = loc[j];
                loc[j] = temp;
            }
        }
    }
    //the desired distance is the total minimum
    dis = (loc[2] - loc[1]) + (loc[1] - loc[0]);
    //printing the distance
    printf("%d", dis);


    return 0;
}
