['#include<stdio.h>
#define IN(a) scanf("%d",&a)
#define OUT(a,b) printf("%d %d\n",a,b)
int lrg(int a,int b)
{
    if(a>b)
        return a;
    else
        return b;
}
int main()
{
    int n;
    IN(n);
    char s[n+1];
    scanf(" %[^\n]",s);
    int temp_len=0,len=0,wrd=0,brac=0;;
    for(int i=0;i<n;i++)
    {
        if(!brac)
        {
            if(s[i]=='_' || s[i]=='(')
            {
                len=lrg(temp_len,len);
                temp_len=0;
                if(s[i]=='(')
                    brac=1;
            }
            else
            {
                temp_len++;
            }
        }
        else
        {
            if(((s[i-1]>='a' && s[i-1]<='z') || (s[i-1]>='A' && s[i-1]<='Z')) && (s[i]==')' || s[i]=='_'))
            {
                wrd++;
            }
            if(s[i]==')')
                brac=0;
        }
    }
    OUT(len,wrd);
    return 0;
}
']

