        for(i=0;i<3;i++){
            if(arr[i]>ans){
                plus++;
            }
            else if(arr[i]<ans){
                minus++;
            }
        }
        if((det2*plus)<(det*minus)){
            rans=rans+1;
        }
        
        

    }
   

    for(i=0;i<3;i++){
        distance=distance+(abs(arr[i]-rans));
    }

    printf("%d",distance);
    return 0;
}
