['#include <stdio.h>
#include <stdlib.h>

int main(){
    int n,i,Win=0,MaxL=0,ln=0;
    char srce [256];
    scanf("%d",&n);     //Scanning for n
    scanf("%s",srce);    //Scanning the whole text as one string
    for (i=0;i<n;i++){    //iterating for each char in the text
        if(srce[i]=='('){                  //Catching each starting '(' to handle it reaching to ')'
             i++;                          //Incrementing for the next char after '('
             while(srce[i]!=')'){           // Looping until reaching the next ')'
                while(srce[i]=='_')i++;      // Skipping all next '_'
                if (srce[i]==')')break;   //Checking ...if this () including "_" only it will break this loop
                Win++;                      // If he reached her i must be the index of first char of a word
                while(1){   //iterating till Skipping the whole word
                    i++;
                    if (srce[i]=='_'||srce[i]==')')break;
                }
             }
             continue;       // Continuing the main for
        }
        while(srce[i]=='_')i++;            //Eliminating all '_' if there
        while(srce[i]!='_'&&srce[i]!='('&&i<n){     //Measuring the len of current word
                ln++;
                i++;
        }
        if (srce[i]=='(')i--;
        if (ln>MaxL)MaxL=ln;        //Storing the max len
        ln=0;                       //making ln =0 to be ready for the next word
    }
    printf("%d %d",MaxL,Win);
    return 0;
}
