int comp(void *x,void *y)
{
    int *a=(int*)x;
    int *b=(int*)y;
    if(*a>*b)
    {
        return +1;
    }
    else if(*a<*b)
    {
        return -1;
    }
    else
    {
        return 0;
    }
}
