{
    int s[3],i,j,sum=0;
    for(i=0;i<3;i++)
    {
        scanf("%d",&s[i]);
    }

    qsort(s, 3, sizeof(int), comp);
    sum=(s[1]-s[0])+(s[2]-s[1]);
    printf("%d\n",sum);
}
