['#include <stdio.h>
#include <stdlib.h>

int main()
{   
     int size,i=0, k=0;            //declare variable
    int max=0,              // maximum of letters outside paranthesis
        letter=0,         // number of letters in each word outside paranthesis
        Words=0;           //number of words inside paranthesis
  
    scanf("%d",&size);     //input the size

    char arr[size];         // declare and input the letters
    scanf("%s",arr);


       if(arr[0]=='(' && arr[size-1]==')'){
        max=0;
      }
    for(i=0;i<size;i++){          // loop to check all the letters

        if (arr[i]!='('){         // in case the letter is not ()
            while (arr[i]!='_' && arr[i]!='('&& arr[i]!='\0'){ //to check if the letter isn't _ nor ) nor the word is finished
                letter++;
                i++;
            }
            if (letter > max){                // check for the maximum letters of a word outside paranthesis
                    max = letter;     
            }
               letter =0;                 //initialize the letter to check another word

        }

        if(arr[i]=='('){                  // in case there is ()
           i++;
            while (arr[i]!=')'){         
                while(arr[i]=='_'){
                       i++;
                }
                   if(arr[i]!=')'){              //if the paranthesis is not ended after _
                      while(arr[i]!='_' && arr[i]!=')'){   //loop for check when the word is terminated
                           i++;
                      }
                      Words++;                     //count new word
                      while(arr[i]=='_'){    //if there is another _ check them till they finished
                          i++;
                      }
                   } 
            }
        }
    }
    printf("%d %d",max,Words);       //printing the output
    return 0;
}
']

