['#include<stdio.h>
void sort(int arr[])
{
for(int i=0;i<3;i++)
{
for(int j=0;j<2;j++)
{
if(arr[j]>arr[j+1])
{
int temp=arr[j+1];
arr[j+1]=arr[j];
arr[j]=temp;
}
}
}
}
int main()
{
    int ar[3];
    scanf("%d%d%d",&ar[0],&ar[1],&ar[2]);
    sort(ar);
    printf("%d",(ar[2]-ar[1])+(ar[1]-ar[0]));
